import React from 'react'
import styled from 'styled-components'
import { data } from '../mock/data'
import { Logo, Nav, NavButton } from '../styles/nav'
import { Page } from '../styles/Page'
import { MainBody } from '../styles/main'
import { Button } from '../styles/button'
import { FaPlus } from 'react-icons/fa'

const Profile = () => {
    return (
        <Page>
            
            <Nav>
                <Logo>
                    Zumthor
                </Logo>
                
                <NavButton>
                    Sair
                </NavButton>                               
            </Nav>

            <MainBody>
                <ProfileSection>
                    <SectionHeader>
                        <SectionTitle>
                            ReferÃªncias de Projeto
                        </SectionTitle>
                        <AddButton>
                            <FaPlus />
                        </AddButton>
                    </SectionHeader>
                    <SectionBody>
                        {data.map(room => (
                            <SectionProject key={room._id}>
                                <SectionImage src={room.thumbnail} />
                                <SectionDescription>
                                    <p>{room.title}</p>
                                    <p>{room.score}</p>
                                </SectionDescription>
                            </SectionProject>
                        ))}                        
                    </SectionBody>
                    
                </ProfileSection>
                <ProfileSection>
                    oi
                </ProfileSection>
            </MainBody>

        </Page>
    )
}

export default Profile

const ProfileSection = styled.section`    
    min-height: 30vh;
    width: 100%;

    display: flex;
    align-items: center;
    
    flex-direction: column;
    margin: 15px 0;    
`
const SectionHeader = styled.div`
    width: 100%;   
    padding: 15px;

    display: flex;
    align-items: center;
    justify-content: space-between;
`
const SectionTitle = styled.h2`
    font-size: 16px;
`
const AddButton = styled(Button)`
    height: 45px;
    width: 45px;
`
const SectionBody = styled.div`    
    width: 100%;    
    padding: 15px;
    display: flex;
`
const SectionProject = styled.div`    
    width: 200px;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    margin-right: 15px;
`
const SectionImage = styled.img`
    height: 100%;
    object-fit: cover;
    width: 100%;
`
